import Registration from './Componants/Login/Registration';
import Home from './Componants/Home';
import About from './Componants/About';

import React from 'react';

function App() {
  // let match = useMatch();
  return (

    <Router>
      <Home />
      <Routes>
        <Route path="/" elemt={<Home />} />
        <Route path="/About" elemt={<About />} />
        <Route path="/Login" elemt={<LoginRegistration />} />
        <Route path="/Registration" elemt={<Registration />} />
      </Routes>

    </Router >



  );
}

export default App;
